import * as React from 'react';
import {Button,Text,View} from 'react-native';
import {NavigationContainer} from '@react-navigation/native';
import {createNativeStackNavigator} from '@react-navigation/native-stack';
import CountChange from './CountChange';
import KeyPad from './KeyPad';
import LivingRoom from './LivingRoom';
import GuessNumber from './GuessNumber';
import Games from './Games';

const Stack = createNativeStackNavigator();

const HomeScreen = ({navigation}) => {
    return (
     <View>
            <Button
                title="Game Room"
                onPress={() =>
                navigation.navigate('Games') 
                }
            />
            <Button
                title="Game Room"
                onPress={() =>
                navigation.navigate('Games') 
                }
            />
            <Button
                title="Alarm Clock"
                onPress={() =>
                navigation.navigate('AlarmClock') 
                }
            />

      </View>
    );
  };
  const ProfileScreen = ({navigation, route}) => {
    return <Text>This is {route.params.name}'s profile</Text>;
  };

const MyStack = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen
          name="Home"
          component={HomeScreen}
          options={{title: 'Welcome back Captain!'}}
        />
        <Stack.Screen name="Profile" component={ProfileScreen} />
        <Stack.Screen name="CountChange" component={CountChange} />
        <Stack.Screen name="KeyPad" component={KeyPad} />
        <Stack.Screen name="LivingRoom" component={LivingRoom} />
        <Stack.Screen name="GuessNumber" component={GuessNumber} />
        <Stack.Screen name="Games" component={Games} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default MyStack;
